import React from 'react';
import './Co.css';

function Contact() {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1>Contact Us</h1>
      <p>For inquiries, please email us at <strong>csecu@university.edu</strong></p>
    </div>
  );
}

export default Contact;
